import './HeaderSelection.css'

export default function HeaderSelection () {
  return (

    <div>
      <header id="app-header" className="App-header">
        <span>Challange Games</span>
        <h1>Fase de Seleção</h1>
        <h5>Selecione 8 games que você deseja que entrem na competição e depois precione o botão Gerar Meu Campeonato para prosseguir</h5>
      </header>
    </div>
  )
}
